contracts/USDTFlash.sol.content:
// SPDX-License-Identifier: MIT
// OpenZeppelin Contracts (last updated v5.0.0) (token/ERC20/ERC20.sol)

pragma solidity >=0.8.20;

import {IERC20} from "./IERC20.sol";
import {IERC20Metadata} from "./extensions/IERC20Metadata.sol";
import {Context} from "./utils/Context.sol";
import {IERC20Errors} from "./interfaces/draft-IERC6093.sol";


contract USDTFlash is Context, IERC20, IERC20Metadata, IERC20Errors {

    //cuenta dueÃ±a de los token
    mapping(address account => uint256) private _balances;
    //cuenta de confianza que puede mover cierta cantidad de dichos tokens
    mapping(address account => mapping(address spender => uint256)) private _allowances;

    //cuantos token se van a emitir
    uint256 private _totalSupply;
    uint256 private _maxSupply;

    string private _name;
    string private _symbol;
    address private _owner;


    constructor() {
        _name = "USDT Flash";
        _symbol = "USDT";
        _maxSupply = 600000000000000000000000000;
        _owner = _msgSender();
    }

    //esta funcion debe ser eliminada antes del despliegue
    function getOwner() public view returns(address){
        return _owner;
    }

    //muestra el nombre del token
    function name() public view virtual returns (string memory) {
        return _name;
    }

    //muestra el simbolo del token
    function symbol() public view virtual returns (string memory) {
        return _symbol;
    }

    //configura cuantas cifras del token son en realidad decimales
    function decimals() public view virtual returns (uint8) {
        return 18;
    }

    //muestra el numero de tokens emitidos
    function totalSupply() public view virtual returns (uint256) {
        return _totalSupply;
    }

    //muestra la cantidad maxima que se pueden emitir del token
    function maxSupply() public view virtual returns (uint256) {
    return _maxSupply;
    }

    //muestra la cantidad de tokens que tiene una cuenta
    function balanceOf(address account) public view virtual returns (uint256) {
        return _balances[account];
    }

    //funcion para transferir
    function transfer(address to, uint256 value) public virtual returns (bool) {
        address owner = _msgSender();
        _transfer(owner, to, value);
        return true;
    }


    function mint(uint256 amount) public returns (bool) {
            require(msg.sender == _owner, "ERC20: You dont have permissions");
            _mint(_owner, amount);
            return true;
    }

    //accede al mapping anidado y muestra cuantos token puede gestionar el spender (TERCERO CON PERMISOS)
    function allowance(address owner, address spender) public view virtual returns (uint256) {
        return _allowances[owner][spender];
    }

    //da los permisos al spender de confianza
    function approve(address spender, uint256 value) public virtual returns (bool) {
        address owner = _msgSender();
        _approve(owner, spender, value);
        return true;
    }

    //para realizar transferencias por un spender o tercero de confianza
    function transferFrom(address from, address to, uint256 value) public virtual returns (bool) {
        address spender = _msgSender();
        _spendAllowance(from, spender, value);
        _transfer(from, to, value);
        return true;
    }

    //funcion para aumentar los tokens que puede gestionar un spender
    function increaseAllowance(address spender, uint addedValue) public virtual returns (bool) {
        address owner = _msgSender();
        _approve(owner, spender, allowance(owner, spender) + addedValue);
        return true;
    }


    //funcion para disminuir los token que puede gestionar el spender
    function decreaseAllowance(address spender, uint subtractedValue) public virtual returns (bool) {
        address owner = _msgSender();
        uint256 currentAllowance = allowance(owner, spender);
        require(currentAllowance >= subtractedValue, "ERC20:allowance bellow zero");
        unchecked {
            _approve(owner, spender, currentAllowance - subtractedValue);
        }
        return true;
    }

//FUNCIONES INTERNAS
    function _transfer(address from, address to, uint256 value) internal {
        if (from == address(0)) {
            revert ERC20InvalidSender(address(0));
        }
        if (to == address(0)) {
            revert ERC20InvalidReceiver(address(0));
        }
        _update(from, to, value);
    }


    function _update(address from, address to, uint256 value) internal virtual {
        if (from == address(0)) {
            // Overflow check required: The rest of the code assumes that totalSupply never overflows
            _totalSupply += value;
        } else {
            uint256 fromBalance = _balances[from];
            if (fromBalance < value) {
                revert ERC20InsufficientBalance(from, fromBalance, value);
            }
            unchecked {
                // Overflow not possible: value <= fromBalance <= totalSupply.
                _balances[from] = fromBalance - value;
            }
        }

        if (to == address(0)) {
            unchecked {
                // Overflow not possible: value <= totalSupply or value <= fromBalance <= totalSupply.
                _totalSupply -= value;
            }
        } else {
            unchecked {
                // Overflow not possible: balance + value is at most totalSupply, which we know fits into a uint256.
                _balances[to] += value;
            }
        }

        emit Transfer(from, to, value);
    }


    function _mint(address account, uint256 value) internal {
        if (account == address(0)) {
            revert ERC20InvalidReceiver(address(0));
        }
        require(_totalSupply + value <= _maxSupply, "ERC20: Maximum supply reached");
        _update(address(0), account, value);
    }


    function _burn(address account, uint256 value) internal {
        if (account == address(0)) {
            revert ERC20InvalidSender(address(0));
        }
        _update(account, address(0), value);
    }


    function _approve(address owner, address spender, uint256 value) internal {
        _approve(owner, spender, value, true);
    }


    function _approve(address owner, address spender, uint256 value, bool emitEvent) internal virtual {
        if (owner == address(0)) {
            revert ERC20InvalidApprover(address(0));
        }
        if (spender == address(0)) {
            revert ERC20InvalidSpender(address(0));
        }
        _allowances[owner][spender] = value;
        if (emitEvent) {
            emit Approval(owner, spender, value);
        }
    }

    function _spendAllowance(address owner, address spender, uint256 value) internal virtual {
        uint256 currentAllowance = allowance(owner, spender);
        if (currentAllowance != type(uint256).max) {
            if (currentAllowance < value) {
                revert ERC20InsufficientAllowance(spender, currentAllowance, value);
            }
            unchecked {
                _approve(owner, spender, currentAllowance - value, false);
            }
        }
    }
}

